import React, { Component } from "react";
import { render } from "react-dom";
import { Stage, Layer, Rect, Text, Circle } from "react-konva";
import Konva from "konva";
import ToneLibrary from "./ToneLibrary";
import Loop from "./Loop";
import Portal from "./Portal";
import BottomNav from "./BottomNav";
import MountedTones from "./MountedTones";
import { connect } from "react-redux";
import reducer from "../reducers";
import middleware from "../middleware";
import { Provider } from "react-redux";
import { createStore } from "redux";
import MountedLoops from "./MountedLoops";
import NewLoop from "./NewLoop";
import Cord from "../components/Cord";

class LeftNav extends React.Component {
  render() {
    return (
      <React.Fragment>
        <ToneLibrary /> <NewLoop />
      </React.Fragment>
    );
  }
}

const ConnectedLeftNav = connect()(LeftNav);

export default ConnectedLeftNav;
